pragma solidity ^0.8.0;

import "../interfaces/IERC20.sol";
import "../interfaces/ILendingPool.sol";

//MUST UPGRADE TO V3!!!!!!!!!
//CURRENTLY USING V1!!!!!!!!!!

contract AAVEActions {

    IERC20 USDC = IERC20(0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174);
    IERC20 DAI = IERC20(0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063);
    IERC20 USDT = IERC20(0xc2132D05D31c914a87C6611C10748AEb04B58e8F);
    ILendingPool LendingPool = (ILendingPool(ILendingPoolAddressesProvider(0xd05e3E715d945B59290df0ae8eF85c1BdB684744).getLendingPool()));
    

    //AAVE Token Addresses
    address constant amDAI = 0x27F8D03b3a2196956ED754baDc28D73be8830A6e;
    address constant amUSDC = 0x1a13F4Ca1d028320A707D99520AbFefca3998b7F;
    address constant amUSDT = 0x60D55F02A771d515e077c9C2403a1ef324885CeC;

    function depositStablesAAVE() internal {

        uint16 REFERRAL_CODE = uint16(0);

        uint daiAmt = DAI.balanceOf(address(this));
        uint USDCAmt = USDC.balanceOf(address(this));
        uint USDTAmt = USDT.balanceOf(address(this));

        DAI.approve(address(LendingPool), daiAmt );
        USDC.approve(address(LendingPool), USDCAmt);
        USDT.approve(address(LendingPool), USDTAmt);

        LendingPool.deposit(address(DAI), daiAmt , address(this), REFERRAL_CODE);
        LendingPool.deposit(address(USDC), USDCAmt , address(this), REFERRAL_CODE);
        LendingPool.deposit(address(USDT), USDTAmt , address(this), REFERRAL_CODE);

    }

    function depositCRVAAVE() internal {
        uint16 REFERRAL_CODE = uint16(0);
        address CRVAddr = 0x172370d5Cd63279eFa6d502DAB29171933a610AF;
        uint CRVAmt = IERC20(CRVAddr).balanceOf(address(this));
        IERC20(CRVAddr).approve(address(LendingPool), CRVAmt );
        LendingPool.deposit(CRVAddr, CRVAmt, address(this), REFERRAL_CODE);
    }



    function withdrawAAVE() internal {

    }

    
    
}

